import React from "react";
import sea from "../img/sea.webp";
import workout from "../img/workout.svg";

export default function Showcase() {
    return(
        <section className="relative">
        <div className="flex flex-col-reverse lg:flex-row items-center gap-12">
        <div className="w-full relative h-screen flex">
            <img src={sea} className="w-full h-full object-cover absolute mix-blend-overlay" />
        <div className="flex flex-1 flex-col items-center lg:items-start">
            <h1 class="text-left text-white text-6xl ">Unleash your healthiest self</h1>
        </div>  
        <img src={workout} className="p-10 invisible md:visible flex-auto w-1/2" alt=""></img>     
        </div>
        </div>
        </section>
    )
}
